import React from 'react';
import { Link } from 'react-router-dom';
import './opciones_admin.css'

const RoleSelection = () => {
  return (
    <div className="role-selection">
      <button className="role-button" variant="contained" size="large">
        <Link to="/login_cliente">Cliente</Link>
      </button>
      <button className="role-button" variant="contained" size="large">
        <Link to="/login_admin">Administrador</Link>
      </button>
    </div>
  );
};

export default RoleSelection;
